import React, { PureComponent } from 'react'
import { Button, Navbar, Card } from "react-bootstrap";
import { useRouteMatch } from 'react-router-dom';

// rfc
class LogInPage extends PureComponent {
//     let { path, url, location } = useRouteMatch();
//     console.log("location: ,",path," ",url);
async loginmtd(){
    console.log("in login mtd");
    const res = await fetch("https://chinmayi-dropbox.auth.us-east-2.amazoncognito.com/login?client_id=5rvr724i7hngpqmmivbdo35gum&response_type=token&scope=aws.cognito.signin.user.admin+email+openid&redirect_uri=http://localhost:3000");
    console.log("resp after cognito fetch");
}
render(){
    return (
        <div>
            <Navbar bg="dark" variant="dark">
                <Navbar.Brand>DropBucket</Navbar.Brand>
            </Navbar>

            <Card style={{ width: '18rem', margin: "100px", justifyContent: "center"}}>
                <Card.Header>Welcome to the DropBucket App</Card.Header>
                <Card.Body>
                    <Card.Text></Card.Text>
                    <Button  variant="primary" onClick={event => this.loginmtd()} >
                        LogIn / SignUp  </Button>
                </Card.Body>
            </Card>

        </div>

    );
    }
}

export default LogInPage
